CREATE TABLE layoffs(
   Company                    VARCHAR(29) NOT NULL
  ,Location_HQ                VARCHAR(16) NOT NULL
  ,Industry                   VARCHAR(14) NOT NULL
  ,Laid_Off_Count             INTEGER 
  ,Percentage                 VARCHAR(20)
  ,Date                       DATE 
  ,Source                     VARCHAR(398) NOT NULL
