  ,Stage                      VARCHAR(14) NOT NULL
  ,Date_Added                 VARCHAR(19) NOT NULL
  ,Country                    VARCHAR(20) NOT NULL
  ,List_of_Employees_Laid_Off VARCHAR(162)
);
